import React from 'react';
import {makeStyles} from '@material-ui/core/styles';
import Paper from '@material-ui/core/Paper';
import Button from '@material-ui/core/Button';
import Typography from '@material-ui/core/Typography';
import Grid from '@material-ui/core/Grid';
import TextField from '@material-ui/core/TextField';
import SecondaryLayout from "../_layouts/default/SecondaryLayout";
import Container from "@material-ui/core/Container";
import styled from "styled-components";

const useStyles = makeStyles(theme => ({
    button: {
        marginTop: theme.spacing(3),
        marginLeft: theme.spacing(1),
    },
}));

const ButtonsGroup = styled.div`
        display: flex;
        justify-content: flex-end;
`


const PageCaptionSpacer = styled.div`
    padding: ${({theme}) => theme.spacing(4, 0)}px;
`

const InnerFormSpacer = styled(Paper)`
        margin-bottom: ${({theme}) => theme.spacing(3)}px;
        padding: ${({theme}) => theme.spacing(2)}px;
        ${({theme}) => theme.breakpoints.up(600 + theme.spacing(3) * 2)} {
            margin-bottom: ${({theme}) => theme.spacing(6)}px;
            padding: ${({theme}) => theme.spacing(3)}px;
        },
`

const SuggestWrapper = styled(Container)`
        width: auto;
        margin-left: ${({theme}) => theme.spacing(2)}px;
        margin-right: ${({theme}) => theme.spacing(2)}px;
        ${({theme}) => theme.breakpoints.up(600 + theme.spacing(2) * 2)} {
            width: 600px;
            margin-left: auto;
            margin-right: auto;
        };
`

function SuggestForm() {
    // description, type (two checkboxes), background url input (if checkbox true)
    return (
        <>
            <Grid container spacing={3}>
                <Grid item xs={12}>
                    <TextField
                        required
                        id="description"
                        name="description"
                        label="Description"
                        fullWidth
                        autoComplete="Description"
                        color="secondary"
                    />
                </Grid>
            </Grid>
        </>
    )
}

function SuggestContainer() {
    const classes = useStyles();

    return (
        <SecondaryLayout>
            <PageCaptionSpacer>
                <Container maxWidth="xl">
                    <Typography component="h1" variant="h5" align="left" color="textPrimary">
                        Письмо дизайнерам
                    </Typography>
                </Container>
            </PageCaptionSpacer>

            <SuggestWrapper maxWidth="xl">
                <InnerFormSpacer>
                    <SuggestForm/>
                    <ButtonsGroup>
                        <Button variant="contained" className={classes.button}>Предложить</Button>
                    </ButtonsGroup>
                </InnerFormSpacer>
            </SuggestWrapper>

        </SecondaryLayout>
    );
}

export default SuggestContainer
